import React from 'react';

const Statistics = ({ statistics }) => {
  const activePercentage = (statistics.activeUsers / statistics.totalUsers) * 100;
  
  return (
    <div className="statistics">
      <h3>System Statistics</h3>
      <div>Total Users: {statistics.totalUsers}</div>
      <div>Active Users: {statistics.activeUsers}</div>
      <div>New Signups: {statistics.newSignups}</div>
      <div>Active Users: {activePercentage}%</div>
    </div>
  );
};

export default Statistics;
